import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { Fetchdata } from './Store2'

const Home2 = () => {

    const { loading, data, error } = useSelector((state) => state)

    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(Fetchdata())
    }, [])

    if (loading == true) {
        return (
            <>
                <h1>Loading...</h1>
            </>
        )
    }
    return(
        <>
          <table border={1} cellPadding={7}nce>
            <tr>
                <th>id</th>
                <th>name</th>
                <th>email</th>
                <th>password</th>
            </tr>
            {
                data && data.map((e)=>{
                    return(
                        <>
                             <tr>
                                <td>{e.id}</td>
                                 <td>{e.name}</td>
                                  <td>{e.email}</td>
                                   <td>{e.password}</td>
                             </tr>
                        </>
                    )
                })
            }
          </table>
        </>
    )
}

export default Home2
